import React from "react";
import Logo from "../../svg/Logo";
import "./style.css";

export default function HeaderCheckout() {
  return (
    <div className="header">
      <div
        className="button"
        style={{
          width: "35px",
          height: "35px",
          marginRight: "92%",
          cursor: "pointer",
        }}
      >
        <img
          src="https://cdn-icons-png.flaticon.com/512/54/54476.png"
          alt="back_button"
        />
      </div>

      <div
        style={{
          position: "absolute",
          marginLeft: "auto",
          marginRight: "auto",
        }}
      >
        <a href="/">
          <Logo />
        </a>
      </div>
    </div>
  );
}
